    {
      Header: "Sr. No.",
      accessor: "srno",
      sortable: false,
      show: true,
      displayValue: " Sr. No.",
      Cell: cellContent => <RightAlign>{cellContent}</RightAlign>

    },
    {
      Header: "Suppression List Name",
      accessor: "sln",
      sortable: false,
      show: true,
      displayValue: "Suppression List Name "
    },
